import React from 'react';


const card = ({name, id, email}) => {
	return(
		<div className='tc bg-light-green dib br3 pa3 ma3 grow bw2 shadow-5 '>
		  <h1> Robo Friends </h1>
		  <img src= {`https://robohash.org/${id}?100x100`} />
		  <div>
		     <h2> {name} </h2>
		     <p> {email}</p>
		  </div>
		</div>
		);
};

export default card;
